(2, 'comfort', NULL, NULL, '64c2092b9661d1690437931.jpg', 'service-icon-1.png', 'service-icon-2.png', 'service-icon-3.png', 'service-icon-4.png', 'All Day Comfort', 'All Day Comfort', 'All Day Comfort', 'All Day Comfort', 'We believe getting dressed should be the easiest part of your day.', 'We believe getting dressed should be the easiest part of your day.', 'We believe getting dressed should be the easiest part of your day.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2023-05-15 05:33:45', '2023-07-27 00:05:31'),
(3, 'features', 'Our Features', 'Why Choose Us', NULL, 'features-icon-1.png', 'features-icon-2.png', 'features-icon-3.png', NULL, 'We are the best', 'Online Shopping', 'Innovative Solutions', NULL, '<font color=\"#5f6368\" face=\"arial, sans-serif\"><b>Will ensure you the best product</b></font>', 'One of the best online shopping platform.', 'Try to make easy your life&nbsp;', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2023-05-15 05:33:45', '2023-06-04 03:43:07');

