INSERT INTO `faqs` (`id`, `question`, `question_fr`, `answer`, `answer_fr`, `created_at`, `updated_at`) VALUES
(1, 'What payment methods do you accept?', 'আপনি কি পেমেন্ট পদ্ধতি গ্রহণ করেন?', 'We accept a variety of payment methods, including sslcommerz (bkash, Nagad, Rocket) and cash on delivery. You can choose your preferred payment option during the checkout process.', 'আমরা sslcommerz (bkash, Nagad, Rocket) এবং ক্যাশ অন ডেলিভারি সহ বিভিন্ন পেমেন্ট পদ্ধতি গ্রহণ করি। চেকআউট প্রক্রিয়া চলাকালীন আপনি আপনার পছন্দের অর্থপ্রদানের বিকল্প বেছে নিতে পারেন।', '2023-05-15 05:33:45', '2023-05-15 05:33:45'),
(2, 'What is your shipping policy?', 'আপনার শিপিং পলিসি কি?', 'We offer various shipping options to ensure your orders reach you in a timely manner. Our standard shipping usually takes X to Y business days within [your country/region], while expedited shipping is available for quicker delivery. Shipping fees may vary based on your location and order size.', 'আপনার অর্ডার সময়মত আপনার কাছে পৌঁছানো নিশ্চিত করতে আমরা বিভিন্ন শিপিং বিকল্প অফার করি। আমাদের স্ট্যান্ডার্ড শিপিং সাধারণত [আপনার দেশ/অঞ্চল] মধ্যে X থেকে Y ব্যবসায়িক দিন সময় নেয়, যখন দ্রুত ডেলিভারির জন্য দ্রুত শিপিং উপলব্ধ। শিপিং ফি আপনার অবস্থান এবং অর্ডার আকারের উপর ভিত্তি করে পরিবর্তিত হতে পারে।', '2023-05-15 05:33:45', '2023-05-15 05:33:45'),
(3, 'May I ordered on the phone?', 'ফোন এ কি অর্ডার করা যায়? ', 'Please Immediately call hotline number and let us know the problem. ', 'অবশ্যই, ফোন এ অর্ডার করতে আপনি কল করতে পারেন হটলাইন নাম্বারে।', '2023-05-15 05:33:45', '2023-05-15 05:33:45'),
(4, 'Can I track my order?', 'আমি কি আমার অর্ডার ট্র্যাক করতে পারি?', 'Absolutely! Once your order is processed and shipped, you will see your order update in your profile after login.', 'আপনার অর্ডার প্রসেস হয়ে গেলে এবং পাঠানো হলে, লগইন করার পর আপনি আপনার প্রোফাইলে আপনার অর্ডার আপডেট দেখতে পাবেন।', '2023-05-15 05:33:45', '2023-08-05 22:58:32'),
(5, 'What is your return and refund policy?', 'আপনার রিটার্ন এবং রিফান্ড নীতি কি?', 'We want you to be completely satisfied with your purchase. If, for any reason, you are not happy with your order, you can initiate a return within X days of receiving the product. Please make sure the item is in its original condition and packaging. Once we receive the returned item, we will process your refund or exchange according to our policy.', 'আমরা চাই আপনি আপনার ক্রয়ের সাথে সম্পূর্ণরূপে সন্তুষ্ট হন। যদি, কোনো কারণে, আপনি আপনার অর্ডারে সন্তুষ্ট না হন, আপনি পণ্যটি পাওয়ার X দিনের মধ্যে ফেরত দিতে পারেন। অনুগ্রহ করে নিশ্চিত করুন যে আইটেমটি তার আসল অবস্থা এবং প্যাকেজিংয়ে রয়েছে। একবার আমরা ফিরে আসা আইটেমটি পেয়ে গেলে, আমরা আমাদের নীতি অনুযায়ী আপনার ফেরত বা বিনিময় প্রক্রিয়া করব।', '2023-05-15 05:33:45', '2023-05-15 05:33:45');

